import React from 'react';
import './App.css';
import Home from './components/Home';
import Reviewme from './components/Reviewme';
import UpdateContactInfo from './components/UpdateContactInfo';
import Navbar from './components/Navbar';

import { BrowserRouter, Routes, Route } from 'react-router-dom';





function App() {
  return (
    <>

      <div className="container">
        <BrowserRouter>
          <Navbar />
          <Routes>

            <Route path='/' element={<Home />}> </Route>
            <Route path='/reviewMe' element={<Reviewme />}> </Route>
            <Route path='/updatecontactinfo' element={<UpdateContactInfo />}> </Route>


          </Routes>
        </BrowserRouter>
      </div>
    </>

  );
}

export default App;
